// Components
import LoginContainer from "./login/LoginContainer.react.js";
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';



// css
import "./App.css";

// React
import React, { useState } from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useRouteMatch,
  useParams
} from "react-router-dom";

// Backend
import { getHelloWorldMessageService } from "./services/HelloWorldServices";

// TODO: should probably move all routing to a separate file


function App() {
  return (
    <Router>
      <div>
        <Navbar bg="light" expand="lg">
          <Navbar.Brand href="/">New Job Board Application</Navbar.Brand>
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="mr-auto">
              <Nav.Link href="/">Home</Nav.Link>
              <Nav.Link href="/about">About</Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Navbar>
        <Switch>
          <Route path="/">
            <Home />
          </Route>
          <Route path="/employer">
            <Employer />
          </Route>
          <Route path="/about">
            <About />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

function Home() {
  const handleButtonClick = () => {
    getHelloWorldMessageService()
      .then((response) => {
        response.json().then((data) => {
          console.log(data);
        });
      })
      .catch((error) => {
        console.log(error);
      });
  };

  return (
    <div >
      <LoginContainer />
      <button onClick={handleButtonClick}>click to connect to backend </button>
    </div>
  );
}

function About() {
  return <h2>About</h2>;
}

function Employer() {
  return (
    <Router>
      <div>
        <Switch>
          <Route path="/employer/">
            <h2>Hello Employer</h2>
          </Route>
          <Route path="/employer/signup">
            <h2>Employer Signup</h2>
          </Route>
          <Route path="/employer/login">
            <h2>Employer Login</h2>
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
